import React from 'react'
const Blog = ({ blog, view, buttonLabel, buttonFunction }) => {
  const blogStyle = {
    paddingTop: 10,
    paddingLeft: 2,
    border: 'solid',
    borderWidth: 1,
    marginBottom: 5
  }

  if (view){
    return (
    <div style={blogStyle}>
      <p>{blog.title} {blog.author} <button onClick={buttonFunction}>{buttonLabel}</button> </p>
      <p>{blog.url}</p>
      <p>likes {blog.likes} <button>like</button></p>
      <p>{blog.user}</p>
    </div>
    )
  }
  return (
    <div style={blogStyle}>
      {blog.title} {blog.author} <button onClick={buttonFunction}>{buttonLabel}</button>
    </div>
  )
}
export default Blog
